def optimize_wreath_material(m, k, n, s, a, b):
    s_counter = Counter(b)
    length = k + m + n * k
    val = sum(s_counter.values())
    occur = defaultdict(int)
    ok = 0
    i = 0
    done = 0
    start = 0
    while i < m:
        while done != length and i < m:
            occur[a[i]] += 1
            if occur[a[i]] == s_counter[a[i]]:
                ok += 1
            done += 1
            i += 1
        if ok == len(s_counter):
            res = []
            need = length - k
            for j in range(start, start + length):
                if not need:
                    break
                if occur[a[j]] > s_counter[a[j]]:
                    occur[a[j]] -= 1
                    res.append(j + 1)
                    need -= 1
            return (len(res), res)
        else:
            waste = k
            while waste:
                if occur[a[start]] == s_counter[a[start]]:
                    ok -= 1
                occur[a[start]] -= 1
                waste -= 1
                start += 1
                done -= 1
    return -1

